import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./components/home";
import About from "./components/about";
function App() {
  return (
    <>
      <Router>
        <Routes>
          {/* <Navbar /> */}

          <Routes exact path="/">
            <Home />
          </Routes>

          <Routes exact path="/about">
            <About />
          </Routes>
        </Routes>
      </Router>
    </>
  );
}

export default App;
